import React from 'react';
import Banner from './Banner.PNG';
import './welcome';

const Welcomepage = () => {
  return (
    <div className='banner'>
      <img src={Banner} className="App-banner" class ="img-fluid" alt="banner" display="flex"/>
    </div> 
  );
};

export default Welcomepage;
